import React from 'react';
import Header from "./components/Header";
import Navbar from "./components/Navbar";
import About from "./components/About";
import Contact from "./components/Contact";
import Work from "./components/Work";

function app() {
  return (
    <div>
      <Navbar />
      <Header />
      <Work />
      <About />
      <Contact />
    </div>
  )
}

export default App
